import React from "react";
import Card from "./Card";

function New(props){
  return(
    <div>
      <h2>
        {props.name}
      </h2>
      <img src="props.img" alt="avatar_img" />
      <p>{props.tel}</p>
      <p>{props.email}</p>
    </div>

  )
}

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card/>
    </div>
  );
}

export default App;
